import React, { Component } from 'react'

export default class Tournaments extends Component {

    constructor(props){
        super(props);
        this.state={tournaments:[]}
    }

    componentWillMount(){
        fetch('https://localhost:8000/tennis')
        .then(res => {res.json()})
        .then(res => {this.state.tournaments=this.setState({...this.state,tournaments:res})});
        console.log("hello");
    }


    render() {
        return (
            <div>
                {this.state.tournaments.map(tournament => {
                    return <tr>{tournament.event_name}</tr>
                })
                }

            </div>
        )
    }
}
